import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { FaFacebook, FaTwitter, FaInstagram, FaLinkedin, FaEnvelope, FaPhone, FaMapMarkerAlt } from 'react-icons/fa';

const Home = () => {
        useEffect(() => {
                const fadeIn = [
                        { opacity: 0 },
                        { opacity: 1 }
                ];

                const fadeInTiming = {
                        duration: 1000,
                        iterations: 1,
                        easing: 'ease-in-out'
                };

                const heroElement = document.querySelector('.hero-content');
                heroElement.animate(fadeIn, fadeInTiming);
        }, []);

        const products = [
                { id: 1, name: "Product 1", price: "$99.99", image: "/product_images/product-1.webp" },
                { id: 2, name: "Product 2", price: "$109.99", image: "/product_images/product-2.webp" },
                { id: 3, name: "Product 3", price: "$89.99", image: "/product_images/product-3.webp" },
                { id: 4, name: "Product 4", price: "$79.99", image: "/product_images/product-4.webp" },
        ];

        return (
                <div className="bg-beige min-h-screen">
                        {/* Hero Section */}
                        <div className="relative w-full h-screen flex items-center justify-center bg-cover bg-center"
                                style={{ backgroundImage: "url('https://source.unsplash.com/1600x900/?luxury,jewelry')" }}>
                                <div className="absolute inset-0 bg-gradient-to-r from-black/70 via-black/30 to-transparent flex items-center px-10">
                                        <div className="max-w-4xl text-white">
                                                <h1 className="text-6xl font-bold text-rosegold leading-tight">Timeless Elegance</h1>
                                                <p className="mt-4 text-lg text-gray-300">
                                                        Discover exquisite handcrafted jewelry designed to captivate and inspire.
                                                </p>
                                                <div className="mt-6 flex space-x-4">
                                                        <Link to="/products" className="px-6 py-3 text-lg font-semibold text-white bg-rosegold rounded-lg shadow-md hover:bg-opacity-80 transition">
                                                                Shop Now
                                                        </Link>
                                                        <Link to="/about" className="text-lg text-gray-300 hover:text-white border-b border-gray-300 hover:border-white transition">
                                                                Learn More
                                                        </Link>
                                                </div>
                                        </div>
                                </div>
                        </div>

                        {/* Featured Products */}
                        <div className="py-16 bg-white">
                                <div className="max-w-7xl mx-auto px-6 text-center">
                                        <h2 className="text-3xl font-extrabold text-gray-900">Featured Products</h2>
                                        <div className="mt-10 grid gap-8 sm:grid-cols-2 lg:grid-cols-3">
                                                {[1, 2, 3].map((item) => (
                                                        <div key={item} className="relative bg-beige rounded-lg shadow-xl overflow-hidden">
                                                                <img src={`https://source.unsplash.com/400x300/?jewelry${item}`}
                                                                        className="w-full h-64 object-cover transition-transform transform hover:scale-105" alt="Jewelry" />
                                                                <div className="p-4 text-center">
                                                                        <h3 className="text-lg font-semibold text-gray-800">Luxury Item {item}</h3>
                                                                        <p className="text-rosegold font-bold text-lg mt-2">$299</p>
                                                                        <button className="mt-4 px-5 py-2 bg-rosegold text-white rounded-lg shadow-md hover:bg-opacity-80 transition">
                                                                                Add to Cart
                                                                        </button>
                                                                </div>
                                                        </div>
                                                ))}
                                        </div>
                                </div>
                        </div>

                        {/* Testimonials */}
                        <div className="py-16 bg-gradient-to-b from-white to-beige">
                                <div className="max-w-6xl mx-auto px-6 text-center">
                                        <h2 className="text-3xl font-extrabold text-rosegold">What Our Customers Say</h2>
                                        <div className="mt-10 grid gap-6 sm:grid-cols-2 lg:grid-cols-3">
                                                {[1, 2, 3].map((item) => (
                                                        <div key={item} className="p-6 bg-white rounded-lg shadow-md hover:shadow-xl transition transform hover:scale-105">
                                                                <p className="text-gray-700 italic">"Absolutely stunning! The quality is unmatched."</p>
                                                                <div className="mt-4 flex items-center space-x-4">
                                                                        <img src={`https://source.unsplash.com/50x50/?person${item}`} className="w-12 h-12 rounded-full border-2 border-rosegold" alt="Customer" />
                                                                        <div>
                                                                                <h4 className="font-semibold text-rosegold">Customer {item}</h4>
                                                                                <p className="text-sm text-gray-600">Verified Buyer</p>
                                                                        </div>
                                                                </div>
                                                        </div>
                                                ))}
                                        </div>
                                </div>
                        </div>
                </div>
        );
};

export default Home;
